import React from 'react';
import useField from '../../hooks/useField';

const Login = () => {

  const username = useField('text');
  const password = useField('password');

  const handleLogin = (e) => {
    e.preventDefault();
    console.log(e.target);

  };

  return (
    <form onSubmit={handleLogin}>
      <input
        {...username}
        reset={undefined}
      />
      <input
        {...password}
        reset={undefined}
      />
      <button type="submit">
        Login
      </button>
    </form>
  );
};

export default Login;
